from Bio import SeqIO


# to get all available records in one go
# example is for protein sequences (10 million lines of data in one FASTA file)
# all the available properties of a biopython record object: # ['__add__', '__bool__', '__class__', '__contains__', '__delattr__', '__dict__', '__dir__', '__doc__', '__eq__', '__format__', '__ge__', '__getattribute__', '__getitem__', '__gt__', '__hash__', '__init__', '__init_subclass__', '__iter__', '__le__', '__le___', '__len__', '__lt__', '__module__', '__ne__', '__new__', '__radd__', '__reduce__', '__reduce_ex__', '__repr__', '__setattr__', '__sizeof__', '__str__', '__subclasshook__', '__weakref__', '_per_letter_annotations', '_seq', '_set_per_letter_annotations', '_set_seq', 'annotations', 'dbxrefs', 'description', 'features', 'format', 'id', 'letter_annotations', 'lower', 'name', 'reverse_complement', 'seq', 'translate', 'upper']
# https://www.ncbi.nlm.nih.gov/sars-cov-2/


database = {}


file_path = "data/sequences.fasta" # replace with the file path of the downloaded FASTA file, this is the entire protein sequence collection of all records in one FASTA file, 500mb+, 10 million lines of data, needs to be downloaded off the site

for record in SeqIO.parse(file_path, "fasta"):
    description_words = record.description.split()
    if description_words[1][1:] not in database:
        database[description_words[1][1:]] = []
    sequence = record.seq
    database[description_words[1][1:]].append(str(sequence))
    
 
for i in database:
    print(i, database[i])


    

